import React from 'react';
import instancesVal from '../instances_val2017.json';

export const parseSuperCategories = ()=>{
	//console.log(typeof (instancesVal));
	return instancesVal.categories.map(item => item.supercategory).filter((value, index, self) => self.indexOf(value) === index);

};
